// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC20 {
    /// @param _owner The address from which the balance will be retrieved
    /// @return balance the balance
    function balanceOf(address _owner) external view returns (uint256 balance);

    /// @notice send `_value` token to `_to` from `msg.sender`
    /// @param _to The address of the recipient
    /// @param _value The amount of token to be transferred
    /// @return success Whether the transfer was successful or not
    function transfer(
        address _to,
        uint256 _value
    ) external returns (bool success);

    /// @notice send `_value` token to `_to` from `_from` on the condition it is approved by `_from`
    /// @param _from The address of the sender
    /// @param _to The address of the recipient
    /// @param _value The amount of token to be transferred
    /// @return success Whether the transfer was successful or not
    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external returns (bool success);

    /// @notice `msg.sender` approves `_addr` to spend `_value` tokens
    /// @param _spender The address of the account able to transfer the tokens
    /// @param _value The amount of wei to be approved for transfer
    /// @return success Whether the approval was successful or not
    function approve(
        address _spender,
        uint256 _value
    ) external returns (bool success);

    /// @param _owner The address of the account owning tokens
    /// @param _spender The address of the account able to transfer the tokens
    /// @return remaining Amount of remaining tokens allowed to spent
    function allowance(
        address _owner,
        address _spender
    ) external view returns (uint256 remaining);

    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    event Burn(address indexed _from, uint256 amount);
}

contract Team {
    bool public taxStatus;
    address public taxWallet;
    uint256 public taxPercent;
    uint256 public burnTaxPercent;
    address public owner;

    mapping(address => bool) public teams;
    event AddedTeam(address indexed addr);
    event RemoveTeam(address indexed addr);
    event UpdatedTax(uint256 indexed percent);
    event ToggleTaxStatus(bool status);
    event UpdatedBurnTaxPercent(uint256 percent);

    constructor() {
        taxWallet = address(1999); // change to team wallet
        owner = msg.sender;
        taxPercent = 6;
        burnTaxPercent = 20;
        addTeamWallet(owner);
    }

    modifier onlyOwer() {
        require(msg.sender == owner, "!owner");
        _;
    }

    function isTeam(address addr) public view returns (bool) {
        return teams[addr];
    }

    // add new team member wallet
    function addTeamWallet(address addr) public {
        require(!isTeam(addr));
        teams[addr] = true;
        emit AddedTeam(addr);
    }

    // remove team wallet
    function removeTeamWallet(address addr) public {
        require(isTeam(addr));
        teams[addr] = false;
        emit RemoveTeam(addr);
    }

    function updateBurnTaxPercent(uint256 percent) public {
        burnTaxPercent = percent;
        emit UpdatedBurnTaxPercent(percent);
    }

    function updateTax(uint256 percent) public {
        taxPercent = percent;
        emit UpdatedTax(percent);
    }

    function toggleTaxStatus() public onlyOwer {
        taxStatus = !taxStatus;
        emit ToggleTaxStatus(taxStatus);
    }
}

abstract contract ACryeatorContent {
    struct Post {
        bool created;
        uint likes;
        uint dislikes;
        uint withdrawn;
        address[] likers;
        address[] dislikers;
    }

    struct ContentReaction {
        bool reacted;
        uint amount;
    }

    event CreatedContent(address indexed author, string indexed contentID);
    event WithdrawContentReward(address indexed author, address indexed withdrawTo, string indexed contentID, uint256 amount);


    error DuplicatedContent();
    error ContentNotFound();

    mapping(address => mapping(string => Post)) public creatorsContent;
    mapping(address=>string[]) public creatorsContentIds;


    function postExits(address creator, string memory contentID) public view returns(bool){
        return creatorsContent[creator][contentID].created;
    }

    function getContent(address creator, string memory contentID) public view returns(Post memory) {
        Post memory post = creatorsContent[creator][contentID];
        require(post.created, "conentet not found");
        return post;
    }

    function getCreatorContentCounts(address creator) public view returns(uint256){
        return creatorsContentIds[creator].length;
    }

    function getCreatorContentByIndex(address creator, uint256 contentIndex) public view returns(Post memory) {
        require(getCreatorContentCounts(creator)>= contentIndex);
        string memory contentID = creatorsContentIds[creator][contentIndex];
        Post memory post = getContent(creator, contentID);
        return post;
    }

    function createContent(string memory contentID) public {
        address creator = msg.sender;

        if (creatorsContent[creator][contentID].created) {
            revert DuplicatedContent();
        }

        creatorsContent[creator][contentID].created = true;
        creatorsContentIds[creator].push(contentID);
    }

    function likeContent(address creator, string memory contentID, uint256 amount) public {
        require(postExits(creator, contentID), "Content not found");

        // remove the amount from user balance
        creatorsContent[creator][contentID].likes += amount;
        creatorsContent[creator][contentID].likers.push(msg.sender);
    }

    function dislikeContent(address creator, string memory contentID, uint256 amount) public {
        require(postExits(creator, contentID), "Content not found");

        // remove the amount from user balance
        creatorsContent[creator][contentID].dislikes += amount;
        creatorsContent[creator][contentID].dislikers.push(msg.sender);
    }

    function withdrawContentEarning(string memory contentID, uint256 amount, address withdrawTo) public {
        address creator = msg.sender;
        Post memory post = getContent(creator, contentID);
        uint256 postEarning = (post.likes - post.dislikes) - post.withdrawn;
        require(postEarning>= amount, "Not enough earnings to withdraw");

        creatorsContent[creator][contentID].withdrawn += amount;

        // process owner withdraw
        withdrawTo;
    }


}

